data.text:
@SF49ersBrasil Muita gente falou exatamente isso ano passado e o Jimmy G voltou jogando bem até acontecer a lesão.
Purdy é bom e será melhor ainda, verdadeiro futuro do 49ers.
Mas, jogar ele na fogueira ano que vem sem um QB experiente para orientar é querer queimar o cara e perder uns 2 SBs.
